import React from 'react';
import {GoogleLogin,GoogleLogout} from 'react-google-login';
import loginWithAccess from "./client/client";


class LoginComp extends React.Component{

	render() {

		return (
			<div>
			<GoogleLogin
		    clientId="436041114033-g9veoeqo9cvqlvia27t30oibijah35mf.apps.googleusercontent.com"
		    buttonText="Login with Google"
		    onSuccess={res => responseGoogle(res)}
		    onFailure={res => responseGoogle(res)}
		    isSignedIn={true}

		  />
    </div>);
	}

}

function responseGoogle(res){
	console.log("done")
	console.log(res)
	console.log(res.getAuthResponse().id_token)
	//client.loginWithAccess()
}


export default LoginComp;
